import React from 'react';
import {Add,Sub,mult,div} from './Calc';
import Card from "./Card";
import Ndata from "./Ndata";
import Netflix from './Netflix';
import Amazon from './Amazon';

const favN = "Netflix";

const ncard = () =>{

    if(favN === "Netflix"){
        return(
            <Card 
            key={Ncard[0].id}
            imgscr ={Ncard[0].imgscr} 
            title = {Ncard[0].title} 
            sname = {Ncard[0].sname} 
            link = {Ncard[0].link}                 
            />
            );
        } else {
            
            return (    
                <Card 
                key={Ncard[2].id}
                imgscr ={Ncard[2].imgscr} 
                title = {Ncard[2].title} 
                sname = {Ncard[2].sname} 
                link = {Ncard[2].link}                 
                />
           
        );
         
        }
        
    }

