function App(){
return(
    <>
    <div className = "main_box">
        
        <div className = "leftDiv">
        <h1 className = "heading">Netflix Series</h1>
            { <ncard />}                    
            
          
        </div>
        <div className = "rightDiv"> 
        <h1 className = "heading">Calculate Amount</h1>           
            <h2>Add : {Add(60,4)}</h2>
            <h2>sub : {Sub(60,4)}</h2>
            <h2>mult : {mult(60,4)}</h2>
            <h2>div: {div(60,3)}</h2>
        </div>
    </div>
    </>
);
}

export default App;
